import request from '@/utils/request'

const baseUrl = `/log/car/car`

export default {
    pageFind(page, limit, carPageParams) {
        return request({
            url: `${baseUrl}/pageFind/${page}/${limit}`,
            method: 'post',
            data: carPageParams
        })
    }
}
